import React from "react";
import "./OrderProductDisplay.css";
import image1 from "../User-images/laptop34.webp";

function OrderProductDisplay() {
  return (
    <div className="order-container my-5 d-sm-flex justify-content-center">
      <div className="order-card custom-order-card">
        <div className="order-card-body">
          <div className="order-media flex-column flex-sm-row align-items-center">
            <div className="order-media-body">
              <h5 className="order-product-title">Blade High Heels Sandals</h5>
              <p className="text-muted">Qt: 1 Pair</p>
              <h4 className="order-product-price">
                <span>&#x20B9;</span> 1,500{" "}
                <span className="payment-method text-muted">via (COD)</span>
              </h4>
              <p className="text-muted" style={{ fontSize: "12px" }}>
                Booked on:{" "}
                <span className="order-booking-time">11:30pm, Today</span>
              </p>
            </div>
            <img
              className="order-product-image img-fluid"
              src={image1}
              width="350"
              height="350"
              alt="Laptop products"
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default OrderProductDisplay;
